import styles from "./OrderList.module.css";

const OrderList = (props) => {
  orders = props.orders;

  return (
    <div>
      <ul>
        <li>
          {orders.map((order) => {
            return (
              <div>
                {order.id} {order.totalAmount}
              </div>
            );
          })}
        </li>
      </ul>
    </div>
  );
};

export default OrderList;
